import './App.css';
import React, { useEffect, useState } from 'react';
import User from './component/User/User';
import Sum from './component/Sum/Sum';
function App() {
  const [users, setUsers] = useState([]);
  useEffect(()=>{
    fetch('data.json')
    .then(res=>res.json())
    .then(data=>setUsers(data));
  },[]);
  return (
    <>
    <Sum></Sum></>
  );
}

export default App;
